import axios from "axios";

const API_URL = "http://localhost:4000/api"; // Backend API URL

const matchService = {
  createMatch: async ({ duration, gameMode }) => {
    try {
      const response = await axios.post(`${API_URL}/create`, { duration, gameMode });
      return response.data; // Returns matchId, duration, endTime, gameMode
    } catch (error) {
      console.error("API Error:", error.response?.data || error.message);
      throw error;
    }
  },
};

export { matchService };
